import React from "react";
import { Link } from "react-router-dom";
import "../css/Main.css";

const Main = () => {
  return (
    <div className="main-container">
      <Link
        to={{
          pathname: "/DistanceOrder",
        }}
      >
        <button className="main-button">
          <img src="path_to_your_png_icon" alt="거리순 아이콘" /> 
        </button>
      </Link>
      <Link to="/CongestionLevelOrder">
        <button className="main-button">
          <img src="path_to_your_png_icon" alt="혼잡도 아이콘" /> 
        </button>
      </Link>
      <Link to="/MapOrder">
        <button className="main-button">
          <img src="path_to_your_png_icon" alt="지도 아이콘" /> 
        </button>
      </Link>
      <Link
        to={{
          pathname: "/HInfo"
        }}
      >
        <button className="main-button">
          <img src="path_to_your_png_icon" alt="병원 정보 아이콘" /> 병원 상세
          정보(테스트)
        </button>
      </Link>
    </div>
  );
};

export default Main;
